import React from "react";

import MenuItem from "../menu-item/menu-item.component";
import SigninCard from "../sign-in-card/signin-card.component";
import Ad from "../ad/ad.component";
import MultiCarousel from "../../components/multi-carousel/multi-carousel.component";
import COLLECTION__DATA from "./collections.data";

import {
  DirectoryMenuContainer,
  DirectoryMenuSubContainer,
  DirectoryMenuFirstRow,
  SpecialCard,
  SpecialCardTop,
  SpecialCardButton,
  DirectoryMenuSecondRow,
} from "./directory.styles";

class Directory extends React.Component {
  constructor(props) {
    super(props);

    this.heightRef = React.createRef();
    this.Line1 = React.createRef();
    this.Line2 = React.createRef();
    this.Line3 = React.createRef();
    this.Line4 = React.createRef();

    this.state = {
      collections: COLLECTION__DATA,
      height: 0,
    };
  }

  componentDidMount() {
    console.log("primera vez");
    //console.log("JODERIKO", this.heightRef.current.clientHeight);
    //this.setState({ height: this.heightRef.current.clientHeight });
    //this.calcularAltura();
    console.log("Line1", this.Line1.current.clientHeight);
    console.log("Line2", this.Line2.current.clientHeight);
    console.log("Line3", this.Line3.current.clientHeight);
    console.log("Line4", this.Line4.current.clientHeight);
    this.calcularAltura();
  }

  calcularAltura = () => {
    this.setState({
      //height: this.heightRef.current.clientHeight,
      height:
        this.Line1.current.clientHeight +
        this.Line2.current.clientHeight +
        this.Line3.current.clientHeight +
        this.Line4.current.clientHeight,
    });
  };

  render() {
    const { advert } = this.state.collections[2];
    console.log("MIRARRR", this.state.height);
    console.log("segunda vez");
    return (
      <DirectoryMenuContainer
        ref={this.Line1}
        height={this.state.height}
        className="directory-menu"
      >
        {
          <DirectoryMenuSubContainer

          //ref={this.heightRef}>
          >
            <button onClick={this.calcularAltura}>PRESIONARRRRRRRR</button>

            <DirectoryMenuFirstRow className="first__row">
              <MenuItem props={this.state.collections[0]} />
              <MenuItem props={this.state.collections[1]} />
              <MenuItem props={this.state.collections[2]} />
              <SpecialCard className="special__card">
                <SpecialCardTop className="special__card__top">
                  <SigninCard
                    props={this.state.collections[3]}
                    advert={advert}
                  />
                </SpecialCardTop>
                <SpecialCardButton className="special__card__buttom">
                  <Ad />
                </SpecialCardButton>
              </SpecialCard>
              <MenuItem props={this.state.collections[3]} />
              <MenuItem props={this.state.collections[4]} />
              <MenuItem props={this.state.collections[5]} />
              <MenuItem props={this.state.collections[6]} />
            </DirectoryMenuFirstRow>

            <div ref={this.Line2}>
              {" "}
              <MultiCarousel title={"Our favorite Toys"} />
              <MultiCarousel title={"Our favorite Toys"} />
            </div>

            <DirectoryMenuSecondRow
              //ref={this.heightRef}
              ref={this.Line3}
              className="second__row"
            >
              <MenuItem props={this.state.collections[7]} />
              <MenuItem props={this.state.collections[8]} />
              <MenuItem props={this.state.collections[9]} />
              <MenuItem props={this.state.collections[10]} />
            </DirectoryMenuSecondRow>
            <div ref={this.Line4}>
              <MultiCarousel title={"Our favorite Toys"} />
              <MultiCarousel title={"Our favorite Toys"} />
              <MultiCarousel title={"Our favorite Toys"} />
            </div>
          </DirectoryMenuSubContainer>
        }
      </DirectoryMenuContainer>
    );
  }
}

export default Directory;
